		"text": "5. 맥주를 마셔라\n\n\"한 잔이면 괜찮을 수 있다. 많은 연구자가 사람들이 덥다고 느낄 때까지 운동을 시킨 다음 알콜이 있는 맥주와 무알콜 맥주를 마시게 하여 원상 체온으로 돌아올 때까지 걸리는 시간을 비교했다.\"",
